function getSubNavList(pathHead){
    const navItem= {
        pathHead,
        navList:[
            {'path':`/${pathHead.lowercase}/list`,'key':`topNav/${pathHead}/list`,'title':`${pathHead} List`},
            {'path':`/${pathHead}/add`,'key':`topNav/${pathHead}/add`,'title':`Add ${pathHead}`},
            {'path':`/${pathHead}/upload`,'key':`topNav/${pathHead}/upload`,'title':`Upload ${pathHead} Spreadsheet`},
        ]
    }
    return navItem
} 
const studentsNav= getSubNavList('students')
const schoolssNav= getSubNavList('schools')
const volunteersNav= getSubNavList('volunteers')
const eventsNav= getSubNavList('events')
const usersNav= getSubNavList('users')

console.log(studentsNav)

export{studentsNav,schoolssNav,volunteersNav,eventsNav,usersNav}
